    var handlePainAssessmentConcepts = function () {
        var painAssessmentSections = form.find(form.rootRecord, 'Pain Assessment');
        for (var i = 0; i < painAssessmentSections.length; i++) {
            var painScore = form.get('PA, Pain Score', i).getValue();
            if (painScore != undefined && painScore >= 1) {
                form.get('PA, Side of pain', i).setHidden(false);
                form.get('PA, Site of pain', i).setHidden(false);
                form.get('PA, Type of pain', i).setHidden(false);
                form.get('PA, When does the pain occur', i).setHidden(false);
                form.get('PA, Site of pain, other', i).setHidden(false);
            } else {
                form.get('PA, Side of pain', i).hideAndClear();
                form.get('PA, Site of pain', i).hideAndClear();
                form.get('PA, Type of pain', i).hideAndClear();
                form.get('PA, When does the pain occur', i).hideAndClear();
                form.get('PA, Site of pain, other', i).hideAndClear();
            }
        }
    };
    if (form.get('PA, Type of assessment').getValue() === 'New assessment' || form.get('PA, Type of assessment').getValue() === 'Re-assessment') {
        form.get('PA, Previous history of physiotherapy').setHidden(false);
        form.get('PA, Affected side').setHidden(false);
        form.get('PA, Does the patient use an assistive device or orthosis?').setHidden(false);
        form.get('Pain Assessment').setHidden(false);
        handlePainAssessmentConcepts();
        form.get('Sensation').setHidden(false);
        form.get('PA, Affected region').setHidden(false);
        form.get('PA, Problem List').setHidden(false);
        form.get('PA, Treatment goals').setHidden(false);
        form.get('PA, Treatment plan and exercises').setHidden(false);
        form.get('PA, Frequency of treatment (sessions / week)').setHidden(false);
        form.get('PA, Estimated duration per session').setHidden(false);
        form.get('PA, Gait and functional status of patient').setHidden(false);
        form.get('PA, Additional comments').setHidden(false);

        form.get('Discharge').hideAndClear();
    }
    else if (form.get('PA, Type of assessment').getValue() === 'Discharge assessment') {
        form.get('PA, Affected side').setHidden(false);
        form.get('PA, Does the patient use an assistive device or orthosis?').setHidden(false);
        form.get('Pain Assessment').setHidden(false);
        handlePainAssessmentConcepts();
        form.get('Sensation').setHidden(false);
        form.get('PA, Affected region').setHidden(false);
        form.get('PA, Gait and functional status of patient').setHidden(false);
        form.get('PA, Additional comments').setHidden(false);
        form.get('Discharge').setHidden(false);

        form.get('PA, Frequency of treatment (sessions / week)').hideAndClear();
        form.get('PA, Estimated duration per session').hideAndClear();
        form.get('PA, Problem List').hideAndClear();
        form.get('PA, Treatment goals').hideAndClear();
        form.get('PA, Treatment plan and exercises').hideAndClear();
        form.get('PA, Frequency of treatment (sessions / week)').hideAndClear();
        form.get('PA, Estimated duration per session').hideAndClear();
    }
    else if (form.get('PA, Type of assessment').getValue() === 'Follow-up assessment, communication') {
        form.get('PA, Affected region').setHidden(false);
        form.get('PA, Gait and functional status of patient').setHidden(false);
        form.get('PA, Frequency of treatment (sessions / week)').setHidden(false);
        form.get('PA, Estimated duration per session').setHidden(false);
        form.get('PA, Additional comments').setHidden(false);
        form.get('Discharge').hideAndClear();
        form.get('PA, Affected side').hideAndClear();
        form.get('PA, Does the patient use an assistive device or orthosis?').hideAndClear();
        form.get('Pain Assessment').hideAndClear();
        form.get('Sensation').hideAndClear();
        form.get('PA, Problem List').hideAndClear();
        form.get('PA, Treatment goals').hideAndClear();
        form.get('PA, Treatment plan and exercises').hideAndClear();
        form.get('PA, Previous history of physiotherapy').hideAndClear();

    } else {
        form.get('PA, Previous history of physiotherapy').hideAndClear();
        form.get('PA, Affected side').hideAndClear();
        form.get('PA, Does the patient use an assistive device or orthosis?').hideAndClear();
        form.get('Pain Assessment').hideAndClear();
        form.get('Sensation').hideAndClear();
        form.get('PA, Affected region').hideAndClear();
        form.get('PA, Problem List').hideAndClear();
        form.get('PA, Treatment goals').hideAndClear();
        form.get('PA, Treatment plan and exercises').hideAndClear();
        form.get('PA, Frequency of treatment (sessions / week)').hideAndClear();
        form.get('PA, Estimated duration per session').hideAndClear();
        form.get('PA, Gait and functional status of patient').hideAndClear();
        form.get('PA, Additional comments').hideAndClear();
        form.get('Discharge').hideAndClear();
        form.get('PA, Type of assistive device or orthosis').hideAndClear();
        form.get('PA, Comments about assistive device or orthosis').hideAndClear();
        form.get('Lower Limb Assessment').hideAndClear();
        form.get('Upper Limb Assessment').hideAndClear();
        form.get('PA, Details of previous physiotherapy').hideAndClear();
        form.get('PA, Other type of assistive device').hideAndClear();
    }
